import React,{Component} from 'react';

class Log extends Component {
constructor(){
  super();
  this.state={
    username:"",
    password :"",
    Login:false,
    store:""
  }
}

Logine(){

fetch('http://127.0.0.1:8000/api/log_in/',{
method:'post',
body:JSON.stringify(this.state)
}).then((response)=>{
response.json().then((result)=>{
  console.warn("result",result);
  localStorage.setItem('Login',JSON.stringify({
    Login:true,
    token:result.token
  }))
})
})
}
render(){

return(

<div>
<h1>login with jwt</h1>
<div>
<input type='text'onChange={(event)=>{this.setState({username:event.targat.value})}}/>
<input type='text'onChange={(event)=>{this.setState({password:event.targat.value})}}/>
<button onClick={this.Logine}>login</button>
</div>
</div>

)

}




}
export default Log;
